/*Credit to Cem Kalyoncu at https://stackoverflow.com/questions/1431094/how-do-i-replace-a-character-at-a-specific-index-in-javascript*/
String.prototype.replaceAt = function(index, replacement) {
	return this.substring(0, index) + replacement + this.substring(index + replacement.length);
}; 

/* credit to chatgpt for this function */
function isSimilar(word1, word2) {
    const threshold = 3;
    const distance = levenshteinDistance(word1, word2);
    return distance <= threshold;
}

function escapeHTML(unsafe)
{
    return unsafe
         .replace(/&/g, "&amp;")
         .replace(/</g, "&lt;")
         .replace(/>/g, "&gt;")
         .replace(/"/g, "&quot;")
         .replace(/'/g, "&#039;");
 }


function addChars(value){
    return value.replaceAll("[colon]",":").replaceAll("[semicolon]",";").replaceAll("[forwardslash]","/").replaceAll("[backslash]","\\").replaceAll("[andchar]","&").replaceAll("[hashtag]","#");
  }

function replaceChars(value){
    return value.replaceAll(":","[colon]").replaceAll(";","[semicolon]").replaceAll("/","[forwardslash]").replaceAll("\\","[backslash]").replaceAll("&","[andchar]").replaceAll("#","[hashtag]");
  }
  
/* credit to chatgpt for this function */
function levenshteinDistance(word1, word2) {
    const dp = [];
    for (let i = 0; i <= word1.length; i++) {
        dp[i] = [i];
    }
    for (let j = 0; j <= word2.length; j++) {
        dp[0][j] = j;
    }
    for (let i = 1; i <= word1.length; i++) {
        for (let j = 1; j <= word2.length; j++) {
            const cost = word1[i - 1] === word2[j - 1] ? 0 : 1;
            dp[i][j] = Math.min(
                dp[i - 1][j] + 1,
                dp[i][j - 1] + 1,
                dp[i - 1][j - 1] + cost
            );
        }
    }
    return dp[word1.length][word2.length];
}

function escapeInvalid(input) {
    return input.replace(/[^\x00-\x7F]/g, '');
}

function escapeInvalid(text) {
    var regex = /[^a-zA-Z0-9_\-\.\s@,?!$&"'']/g;
    var sanitized = text.replace(regex, '');
    return sanitized;
}

